script: |
  super -f text -I q6560.spq | sort > q6560.out

inputs:
  - name: q6560.spq
    data: |
      SELECT + col0 AS col0, + col2 * + 50 FROM tab0 (FORMAT parquet) WHERE NOT NULL BETWEEN - CAST ( + 60 AS INTEGER ) AND + col2 * - col0 + + 15;
  - name: tab0

outputs:
  - name: q6560.out
    data: |
